import React from 'react';
import {BrowserRoute, Link, NavLink} from "react-router-dom";

const Navbar = () => {
 return (
        <nav className= "nav-wrapper red darken-3">
            <div className="container">
                <a className="brand-logo">Varausjärjestelmä</a>
            <ul className="right">
             <p><Link to='/'>Koti</Link> |
                <Link to='/Kuvat'> Kuvat</Link>
                <Link to='/Mökki'> Mökki</Link>
                <Link to='/Peräkärry'> Kärry</Link>
                <Link to='/Ruohonleikkuri'> Leikkuri</Link></p>
            </ul>
            </div>
        </nav>
    );
};



export default Navbar;
